import styled from "styled-components";

export const FooterBox = styled.div`
  width: 100%;
  height: 3rem;
  padding: 10px;
  text-align: center;
  background: #f1f1f1;
  border-top: 1px solid #ccc;
  color: #999;
  position: fixed;
  left: 0;
  bottom: 0;
  z-index: 999;
`;
